import React, {useState} from 'react';
import {registerUrl} from '../../api/Api';
import axios from 'axios';
import { TextField,Box,Input, FormLabel} from '@mui/material';
import Styles from '../auth/styles/SignUp.module.css'

const SignUp = () => {
  const initialValue = {
    firstName: '',
    lastName: '',
    email: '',
    phoneNumber: '',
    password: '',
    userName: '',
  };

  const [data, setData] = useState (initialValue);

  const handleChange = async e => {
    e.preventDefault ();
    setData (prevState => ({
        ...prevState,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async e => {
        e.preventDefault ();
        const userData = {
            userName: data.userName,
            firstName: data.firstName,
            lastName: data.lastName,
            email: data.email,
            phoneNumber: data.phoneNumber,
            password: data.password
        }

        const response = await axios.post(registerUrl, userData)

        if(response.status === 200){
            console.log('BC res --> ',response.data)
        }
    }

  return (
    <div className= {Styles.SignUp}>
      <form className = {Styles.SignUpForm} onSubmit={handleSubmit}>
        <div className = {Styles.SignUpDiv1}>
        <FormLabel htmlFor="">
          FirstName: { " "} 
          <Input 
          value={data.firstName} 
          name="firstName"
           onChange={handleChange} 
           type="text" 
           varient = "outlined"
           />
        </FormLabel>
        </div>
        <div>
        <FormLabel htmlFor="">
        lastName: 
        <TextField
         value={data.lastName} 
        name="lastName" 
        onChange={handleChange} 
        type="text"
        varient = "outlined" 
        />
        </FormLabel>
        </div>
        <div>
        <label htmlFor="">
            email: 
            <input value={data.email} 
            name="email" onChange={handleChange} type="email" />
        </label>
        </div>
        <div>
        <label htmlFor="">
            userName: <input value={data.userName} name="userName" onChange={handleChange} type="text" />
        </label>
        </div>
        <div>
        <label htmlFor="">
            phoneNumber: <input value={data.phoneNumber} name="phoneNumber" onChange={handleChange} type="tel" />
        </label>
        </div>
        <div>
        <label htmlFor="">
        password: <input value={data.password} name="password" onChange={handleChange} type="password" />
        </label>
        </div>
        <div><button type="submit">Submit</button></div>
      </form>
    </div>
  );
};

export default SignUp;
